import React, { Component } from "react";
import { getWorshippers } from "../common/fakeWorshippers";

class Maintable extends Component {
  state = { worshippers: getWorshippers() };
  render() {
    return (
      <div>
        <table className="table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Phone Number</th>
              <th>Service</th>
              <th>Delete</th>
            </tr>
          </thead>
          <tbody>
            {this.state.worshippers.map((worshipper) => (
              <tr key={worshipper._id}>
                <td>
                  {worshipper.FirstName} {worshipper.LastName}
                </td>
                <td>{worshipper.PhoneNumber}</td>
                <td>{worshipper.service.name}</td>
                <td>
                  <button className="btn btn-danger">Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Maintable;
